import logo from './logo.svg';
import './App.css';


const App=()=> {
  return (
    <div className="App">
      <form>
        <h2>CREATE AN ANIME CHARACTER</h2>
        <div>
          <label htmlFor="">ENTER CHARACTER NAME:</label>
          <input type="text" id="name" name="name"></input>
        </div>
        <div>
          <label htmlFor="">ENTER FAVORITE MOVE:</label>
          <input type="text" id="move" name="move"></input>
        </div>
        <div>
          <label htmlFor="">ENTER SKILL LEVEL:</label>
          <input type="number" id="skill" name="move"></input>
        </div>
      </form>
    </div>
  );
}

export default App;
